function plotleftoverdata(T,Z,ZEst,predictionTimes,EODMean,EODMin,EODMax,trueEOD,loads,ref_time,ref_voltage)
% Plot output estimates
figure(1);
clf;
plot(T,Z(1,:),'.',T,ZEst(1,:),'--');
title('Temperature Estimates');
xlabel('Time (s)')
ylabel('Temperature (deg C)');
axis square
box on
ax = gca;
ax.Color = 'None';

if nargin>4
    % Plot prediction results
    figure(4);
    hold on;
    plot(predictionTimes,EODMean,'o','Color','green','DisplayName','Predicted EOD Mean','MarkerFaceColor','green')
    plot(predictionTimes,EODMin,'o','Color','red','DisplayName','Predicted EOD Min','MarkerFaceColor','red')
    plot(predictionTimes,EODMax,'o','Color','blue','DisplayName','Predicted EOD Max','MarkerFaceColor','blue');    
    plot(predictionTimes,trueEOD*ones(size(predictionTimes)),'o','Color','black','DisplayName','True EOD','MarkerFaceColor','black'); 
    hold off;
    axis tight;
    % axis square
    box on
    ax = gca;
    ax.Color = 'None';
    xlabel('Time (s)')
    ylabel('EOD (s)')
end
if nargin>9
    figure(2);
    plot(T,Z(2,:),'.',T,ZEst(2,:),'--');
    hold on
    plot(ref_time,ref_voltage,'-','Color','red');
    hold off
    title('Voltage Estimates');
    xlabel('Time (s)');
    ylabel('Voltage (V)');
    legend('Simulated','Estimated','Experimental');
    axis square
    box on
    ax = gca;
    ax.Color = 'None';
end


function plotTatEOD(t,curTMin,curTMean,curTMax)
    figure(6)
    hold on;
    plot(t,curTMean,'o','Color','green','DisplayName','Estimated T Mean','MarkerFaceColor','green')
    plot(t,curTMin,'o','Color','red','DisplayName','Estimated T Min','MarkerFaceColor','red')
    plot(t,curTMax,'o','Color','blue','DisplayName','Estimated T Max','MarkerFaceColor','blue');
    axis square;
    xlabel('Time (s)')
    ylabel('Temperature (degC)')
    drawnow;
    
function plotEOD(t,curEODMin,curEODMean,curEODMax)
    figure(5)
    hold on;
    plot(t,curEODMean,'o','Color','green','DisplayName','Predicted EOD Mean','MarkerFaceColor','green')
    plot(t,curEODMin,'o','Color','red','DisplayName','Predicted EOD Min','MarkerFaceColor','red')
    plot(t,curEODMax,'o','Color','blue','DisplayName','Predicted EOD Max','MarkerFaceColor','blue');
    axis square;
    xlabel('Time (s)')
    ylabel('EOD (s)')
    drawnow;

function plotT(t,z)
    figure(1);
    subplot(2,1,1)
    hold on
    plot(t,z(1,:),'o','Color','blue','MarkerFaceColor','blue');
    xlabel('Time (s)')
    ylabel('Temperature (deg C)');
    axis square
    box on
    ax = gca;
    ax.Color = 'None';
    subplot(2,1,2)
    hold on    
    plot(t,z(2,:),'o','Color','blue','MarkerFaceColor','blue');
    xlabel('Time (s)')
    ylabel('Voltage (V)');
    axis square
    box on
    ax = gca;
    ax.Color = 'None';    
    drawnow;
    xlim([-10,3700])